		<meta itemprop="datePublished" content="2022-12-04T08:00:00+00:00"/><div class="product-detail"><div class="photo"><img itemprop="image" src="https://i.4pda.ws/s/as6yueQrUwnKt0LgJ5m26uBjbZsccTet21FqwJkADfGw.jpg?v=1669981373" width="400" height="300" srcset="https://i.4pda.ws/s/as6yueQrUwnKt0LgJ5m26uBjbZsccTet21FqwJkADfGw.jpg?v=1669981373 400w, https://i.4pda.ws/s/as6yueQrUwnKt0LgJ5m26uBjbZsccTet80NM.jpg?v=1669981373 800w" sizes="362px" alt="Состоялся релиз Clown of Duty — пародии на Call of Duty" title="Состоялся релиз Clown of Duty — пародии на Call of Duty"/></div><div class="description"><h1 itemprop="name"><span itemprop="headline">Состоялся релиз Clown of Duty — пародии на Call of Duty</span></h1><div class="info-holder"><div class="meta"></div></div><div class="more-box"><em class="date">4.12.22</em><span class="name"><a href="/forum/index.php?showuser=11029883">Оксана Рубко</a></span><span class="number"><a href="https://4pda.to/2022/12/04/406834/sostoyalsya_reliz_clown_of_duty_parodii_na_call_of_duty/#comments"  title="Комментарии к Состоялся релиз Clown of Duty — пародии на Call of Duty">19</a></span></div></div></div><div class="content"><div class="content-box" itemprop="articleBody"><meta property="og:description" content="Несмотря на успешный релиз Call of Duty: Modern Warfare II и Warzone 2.0, геймеры оказались не очень довольны техническим состоянием игр. Форум Reddit заполнен жалобами на баги и просьбами их исправить. Мольбы фанатов были услышаны&amp;nbsp;— правда, другими разработчиками."/><p style="text-align:justify">Несмотря на успешный релиз Call of Duty: Modern Warfare II и Warzone 2.0, геймеры оказались не очень довольны техническим состоянием игр. Форум Reddit заполнен жалобами на баги и просьбами их исправить. Мольбы фанатов были услышаны&nbsp;— правда, другими разработчиками.<!--more--></p>

<p style="text-align:center"><a data-notrack data-yt-player="&lt;iframe style=&quot;width:640px;max-width:100%;height:auto;aspect-ratio:16/9&quot; width=&quot;640&quot; height=&quot;360&quot; src=&quot;//www.youtube.com/embed/8_C-HSNfZsc?rel=0&amp;&quot; frameborder=&quot;0&quot; allowfullscreen&gt;&lt;/iframe&gt;" href="https://www.youtube.com/watch?v=8_C-HSNfZsc" target="blank" class="yt-p-overlay" style="background-image:url(//4pda.to/s/as6yl6rNtiTOWpjdLz0z0Kj0E.jpg);"><span class="yt-p-gradient"></span><span class="yt-p-content"></span></a></p>

<p style="text-align:justify">Студия Riverside Sports <a href="https://store.steampowered.com/app/2205190/Clown_Of_Duty/" target="_blank">выпустила</a> шутер-пародию под названием Clown of Duty. В ней игроки могут выбрать одну из сторон (Спецназ или Delta Force), за которую они будут сражаться в командных матчах на различных локациях. Отзывы об игре&nbsp;в Steam оказались положительными — геймеры хвалят тайтл за удобную систему управления, гибкую прокачку, разнообразие режимов и карт. Пользователи отмечают, что авторы Clown of Duty проделали большую работу над ошибками, усовершенствовав и доработав свой прошлый проект — <a href="//4pda.to/2021/12/20/394575/battlefield_2042_vysmeyali_anonsom_parodijnogo_shutera_clownfield_2042/" target="_blank">Clownfield 2042</a>.</p>

<p style="text-align:justify">Последняя часть Call of Duty с подзаголовком Modern Warfare II вышла в октябре 2022 года на PC, PlayStation 4, PlayStation 5, Xbox One и Xbox Series X/S. Игра принесла создателям более <a href="//4pda.to/2022/11/08/405975/call_of_duty_modern_warfare_ii_prinesla_avtoram_milliard_dollarov_za_10_dnej/" target="_blank">миллиарда долларов</a>&nbsp;за первые 10 дней, а также <a href="//4pda.to/2022/11/02/405740/call_of_duty_modern_warfare_ii_pobila_vse_rekordy_serii_po_prodazham/" target="_blank">побила</a> рекорды серии по продажам.</p>
<p class="mb_source">Источник:&nbsp;<noindex><a rel="nofollow" href="https://store.steampowered.com/app/2205190/Clown_Of_Duty/" target="_blank">store.steampowered.com</a></noindex></p><br /></div></div></div></fs25oA55ul><fMYdSup id="z1jorcEz1nxW" class="fMYdSuZrlHwAiA z2srWCkegG3F9XMue"><X2IGHOBSLh class="slider-list" style="display:none"></X2IGHOBSLh><X2IGHOBSLh class="slider-list" style="display:none"></X2IGHOBSLh><X2IGHOBSLh class="slider-list" style="display:none"></X2IGHOBSLh><div class="q1WupkyVhfT fEJSG57TLVJWXOr0M2wj"><uTah4xRPFw data-revive-zoneid="12" data-revive-id="95e2865faedeea29ba92383e58b41f6a"><Y5UAdPGo3kG8933kKsoj><Y5UAdPGo3kG8933kKsoj><img src='https://4pda.to/s/as6yxxkDKqrVz1Yvz1XjjS6bojDde.gif'   style="width:23px;height:3px;clip:rect(23px 3px 22px 2px);" /></Y5UAdPGo3kG8933kKsoj></Y5UAdPGo3kG8933kKsoj><yOz2SeejkLmz0tqu><z0RvJmKBHLmT7ia><iframe src="https://4pda.to/s/as6ykPBz1MsoFO6gtAaFh50j.html" scrolling="no" frameborder="0" style="overflow:hidden;border:none;width:240px;height:400px;"></iframe></z0RvJmKBHLmT7ia></yOz2SeejkLmz0tqu></uTah4xRPFw><div><script>(function(d,w){var t=d["quer"+"ySelec"+"to"+"r"]('[data-'+'re'+'vive-zoneid="12"]'),a=["class","style","q1Wuwin".toLowerCase(),"id"],j=function(o){if(!o)return;var h=o.attributes,i=h.length-1;for(;i>=0;i--){0>a.indexOf(h[i].name.toLowerCase())&&o.removeAttribute(h[i].name);}},fv=w["xUm25N7I4qnW35"]=function(){if(t){t.style.removeProperty("op"+"ac"+"it"+"y");w["setT"+"ime"+"out"](function(){j(t);j(t.parentNode);},300);}};t&&(t.style["op"+"ac"+"it"+"y"]=0);fv["to"+"S"+"tring"]=fv;w["setT"+"ime"+"out"](fv,1000)})(document,window);</script></div></div><div class="q1WupkyVhfT"><h2 data-revive-zoneid="eHyRagciGHuiZwDvGuB" data-revive-id="eHyRagciGHuiZwDvGuB">Самые комментируемые</h2><ul class="slider-list"><li><span class="title"><a href="https://4pda.to/2024/11/02/434642/u_smartfonov_na_snapdragon_8_elite_nablyudayutsya_problemy_s_peregrevom/?utm_source=mc1" title="У смартфонов на Snapdragon 8 